import './submitDeleteMessages.css';
import '../index.css'

function SubmitDeleteMessages() {

    useEffect(() => { 

    })
  
    return (
    <>
        <div className="submit-delete-messages ui outer container p-20">

            <div class="api-status btn-wrap">
                <button class="submit-delete-messages btn send">
                Send Message
                </button>
                <button class="submit-delete-messages btn delete">
                Delete Messages
                </button>
            </div>

        </div>
    </>
    );
  }

  export {SubmitDeleteMessages}
